import React, { Component } from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    javascript: {
        backgroundColor: 'yellow',
        color: 'black',
        fontWeight: 'bolder'
    }
};

export default class ChipsJavascript extends Component {
    render() {
        return (
            <Chip label="Javascript" style={Style.javascript}/>
        );
    }
}
